sys_variable_value.value:
(function execute(inputs, outputs) {

  const responseBody = inputs.response_body;

  const privateKeyStart = '-----BEGIN EC PRIVATE KEY-----';
  const privateKeyEnd = '-----END EC PRIVATE KEY-----';
  const privateKeyStartIndex = responseBody.indexOf(privateKeyStart);
  const privateKeyEndIndex = responseBody.indexOf(privateKeyEnd, privateKeyStartIndex) + privateKeyEnd.length;
  outputs.private_key = responseBody.substring(privateKeyStartIndex, privateKeyEndIndex);

  const publicKeyStart = 'ecdsa-sha2-nistp521';
  const publicKeyEnd = '\n';
  const publicKeyStartIndex = responseBody.indexOf(publicKeyStart);
  const publicKeyEndIndex = responseBody.indexOf(publicKeyEnd, publicKeyStartIndex);
  outputs.public_key = responseBody.substring(publicKeyStartIndex, publicKeyEndIndex);

})(inputs, outputs);

